-- Таблица: groups
CREATE TABLE groups (
    id        INTEGER    PRIMARY KEY AUTOINCREMENT,
    name      CHAR (30),
    idUsers   INTEGER    REFERENCES users (id) ON DELETE CASCADE
                                               ON UPDATE NO ACTION,
    idCourses INTEGER    REFERENCES courses (id) ON DELETE CASCADE
                                                 ON UPDATE NO ACTION,
    comment   CHAR (100) DEFAULT ('') 
);

