    id       INTEGER     PRIMARY KEY AUTOINCREMENT,
    idGroups INTEGER     REFERENCES groups (id) ON DELETE RESTRICT,
    date     DATETIME,
    tstart    CHAR (5),
    tend    CHAR (5),
    name     CHAR (100),
    present  CHAR (2048),
    estim    CHAR (2048),
    shtraf   CHAR (2048),
    comment  CHAR (100) 
);

