-- Индекс: users_name
CREATE UNIQUE INDEX users_name ON users (
    name
);


-- Триггер: courses_in_groups
CREATE TRIGGER courses_in_groups
        BEFORE DELETE
            ON courses
      FOR EACH ROW
          WHEN (
                   SELECT count( * ) 
                     FROM groups
                    WHERE idCourses = OLD.id
               )
> 0
BEGIN
    SELECT RAISE(ABORT, "groups data used");
END;


